// Credit: https://craftpix.net/freebies/free-game-icons-of-fantasy-knight-armor-pack-11/
import MithrilBootsImg from './mithril-boots.png';

const MithrilBoots = {
    name: 'Mithril Boots',
    type: 'armor::boots',
    effect: {
        defence: 10,
    },
    image: MithrilBootsImg,
    value: 150,
};

export default MithrilBoots;
